class Solution {
    bool solve(int i, int j, int fr, int fc, vector<vector<int>>& nums) {
        if(i==fr && j==fc) return 1;
        if(i>fr || j>fc || nums[i][j]==0) return 0;
        
        nums[i][j]=0;
        return solve(i+1, j, fr, fc, nums) || solve(i, j+1, fr, fc, nums);
    }
public:
    bool isPossibleToCutPath(vector<vector<int>>& nums) {
        int n = nums.size(), m = nums[0].size();
        if(!solve(0, 0, n-1, m-1, nums)) return true;
        nums[0][0]=1;
        return solve(0, 0, n-1, m-1, nums)==false;
    }
};
